import "./App.css";
import styled from "styled-components";

const StyleHeader = styled.div`
  .header {
    /* banner */
    &-banner {
      width: 100%;
      height: 3.2rem;
      background-color: ${(props) => props.theme.primaryColor};
      display: flex;
      justify-content: space-between;
      align-items: center;
      &__left-text {
        font-size: 1.2rem;
        font-weight: 400;
        color: ${(props) => props.theme.whiteColor};
        margin-left: 1rem;
      }
      &__left-icon {
        margin-right: 1rem;
      }
      &__right {
        .menu-banner__right {
          display: flex;
          gap: 0 2rem;
          align-items: center;
          font-size: 1.4rem;
          list-style: none;
          text-decoration: none;
          margin-right: 2rem;
        }
        .menu-banner__link {
          color: ${(props) => props.theme.whiteColor};
          text-decoration: none;
        }
      }
    }
    /* content */
    &-content {
      margin-top: 3.4rem;
      &__main {
        display: flex;
        align-items: center;
        gap: 0 3rem;
      }
      &__center {
        width: 100%;
        max-width: 677px;
        position: relative;
      }
      &__input {
        width: 100%;
        padding: 1.5rem 12rem 1.5rem 3rem;
        border-radius: 2rem;
        border: none;
        border: 1px solid ${(props) => props.theme.grayColor};
        outline: none;
        font-size: 1.5rem;
      }
      &__button {
        position: absolute;
        top: 0;
        right: 0;
        padding: 1.7rem 4rem;
        background-color: ${(props) => props.theme.primaryColor};
        border-radius: 4rem;
        font-size: 1.5rem;
        color: ${props => props.theme.whiteColor};;
      }
      &__tag {
        display: inline-block;
        margin-top: 1rem;
        font-size: 1.3rem;
        font-weight: 700;
        color: ${props => props.theme.textPrimary};
        cursor: pointer;
      }
    }
  }
`;

function App() {
  return (
    <>
      <StyleHeader className="header">
        <div className="header-banner">
          <div className="header-banner__left">
            <p className="header-banner__left-text">
              <i class="fa-solid fa-circle header-banner__left-icon"></i>
              Kệ đựng đũa, dao kéo Hobby Home Decor KDMT3 có khay hứng...: Cao
              Thị Hằng bình luận "Sản phẩm chắc đẹp, mà mấy cái hộp đựng đũa
              hơi..."
            </p>
          </div>
          <div className="header-banner__right">
            <ul className="menu-banner__right">
              <li className="menu-banner__items">
                <a href="/#" className="menu-banner__link">
                  Tải ứng dụng Chiaki
                </a>
              </li>
              <li className="menu-banner__items">
                <a
                  href="/#"
                  className="menu-banner__link"
                  style={{ color: "#FFF5B6" }}
                >
                  Khiếu nại, báo lỗi: 0964.898.762
                </a>
              </li>
              <li className="menu-banner__items">
                <a href="/#" className="menu-banner__link">
                  Tin tức
                </a>
              </li>
              <li className="menu-banner__items">
                <a href="/#" className="menu-banner__link">
                  Tra cứu đơn hàng
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div className="header-content">
          <div className="container">
            <div className="header-content__main">
              <img
                src="/logo-menu.png"
                alt=""
                className="header-content__logo"
              />
              <div className="header-content__center">
                <div className="header-content__form">
                  <input
                    type="text"
                    name=""
                    id=""
                    className="header-content__input"
                    placeholder="Tìm kiếm hàng nghìn Sản Phẩm, Thương hiệu..."
                  />
                </div>
                <a href="/#">
                  <i class="fa-solid fa-magnifying-glass header-content__button"></i>
                </a>
                <p className="header-content__tag">Son Môi, Healthy Care, Blackmores, Obagi, Collagen</p>
              </div>
              <div className="header-content__actions">
                <div className="header-content__list">
                  <div className="header-content__items">
                    <img src="/account.svg" alt="" />
                  </div>
                  <div className="header-content__items">
                    <img src="/faq.svg" alt="" />
                  </div>
                  <div className="header-content__items">
                    <img src="/phone.svg" alt="" />
                    <div className="header-items__content">
                      <p className="header-items__text">Hotline:<span className="header-items__number"></span></p>
                      <p className="header-items__text">Tổng đài:<span className="header-items__number"></span></p>
                    </div>
                  </div>
                  <div className="header-content__items">
                    <img src="/cart.svg" alt="" />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </StyleHeader>
    </>
  );
}

export default App;
